    public static void testMyJsonResolver(String string){
        long start = 0;
        long end = 0;
        System.out.print("Json字符长度："+string.length());
        long time = 0;
        for(int i =0;i<COUNT;i++) {
            start = System.currentTimeMillis();
            Json json = new Json(string);
            json.parse();
            end = System.currentTimeMillis();
            time = time+(end-start);
        }
        System.out.println(" 耗时："+time);
    }


